import Logo from '../Logo';
import Navbar from '../Navbar';
import Card from '../UI/Card';
import './style.css';

/** 
 * @author
 * @function Hero
 **/

 const Hero =(props)=> {
     return(
         <div>
             <Card>
             <div style={{padding:'50px 0'}}>
             <Logo/>
             </div>
             <Navbar/>
             </Card>
         </div>
     )
 }

 export default Hero;
